import React, { useState } from 'react';
import { Document, Page, pdfjs } from "react-pdf";
 pdfjs.GlobalWorkerOptions.workerSrc = `//Users/buw0017/Desktop/BigLeagueInstructions.pdf.js/${pdfjs.version}/pdf.worker.js`;

export default function Instructions() {
  const [numPages, setNumPages] = useState(null);
  const [pageNumber, setPageNumber] = useState(1);

  function onDocumentLoadSuccess(document) {
    setNumPages(document.numPages);
  }

  return (
    <div>
      <Document
        file="/Users/buw0017/Desktop/BigLeagueInstructions.pdf"
        onLoadSuccess={onDocumentLoadSuccess}
      >
      </Document>
    </div>
  );
}
